import React from "react";
import { Card, Container, Row, Col } from "react-bootstrap";

import "./Photos.scss";
/**
 * Displays one photo card with title, author, description and tags.
 * Links are expected to be already constructed on the photo prop.
 */
function PhotoItem({ photo }) {
  return (
    <Card style={{height: '200px'}}>
        <Card.Img src={photo.photoURL || "https://placekitten.com/480/360"} />

        <Card.Body>
          <Card.Title>
            <a href={photo.photoURL} target="_blank">
              {photo.title || "Unknown"}
            </a>
          </Card.Title>
          <Card.Text>
            by{" "}
            <a href={photo.authorURL} target="_blank">
              {photo.ownername}
            </a>
          </Card.Text>
        </Card.Body>
    </Card>
  );
}

export default PhotoItem;
